    for left-hand,nright-hand. This Phase I effort will develop the phase shifter elementnand
    control distribution layer. This planar antenna has the ability tonreconfigure its
    beam width from a narrow, directive beam to ansector-wide beam. The design is easily
    scaleable to support the desiredngain for the specific link. The design and the
    Parascan? phase shifterntechnology that makes this antenna possible are unique to
    ParateknMicrowave, Inc. This antenna will enable NASA to realize a space-basedntelemetry
    system for their reusable launch vehicles, with substantialnsavings from their terrestrial-based
    telemetry systems and revolutionizenbroadband network links for both terrestrial
    and SATCOM communication networks.",nt"license_title": "U.S. Government Work",nt"extras":
